import React from 'react';
import list from '../styles/List.module.css';

const Favorites = ({ item }) => {
  return (
    <article className={list['wrapper--details']}>
    <p>{item.day}</p>

    <p>{item.description}</p>

    <p>{item.duration}</p>

    <p>{item.frequency}</p>

    <p>{item.max_members}</p>

    <p>{item.members}</p>

    <p>{item.title}</p>
  </article>
  )
}

export default Favorites;
